window.bookSummaryJSON = "<p><i>The Convoluted Universe: Book One</i> is the sequel to <i>The Custodians</i>. This book contains some of the more complicated concepts in metaphysics that Dolores Cannon discovered through 20 years of using deep hypnosis to explore the subconscious mind. </p> <p>Some of the topics explored in this book include: </p> <p></p> <ul> <li>The origin, knowledge, and destruction of Atlantis</li> <li>The explanations of Earth's mysteries, including the Pyramids, Easter Island, the Bermuda Triangle, the Ark of the Covenant, Loch Ness Monster, Nazca Lines</li> <li>Characteristics of other planets</li> <li>Parallel universes</li> <li>Parallel lifetimes and realities</li> <li>Other dimensions</li> <li>And much more... </li> </ul> <p>This audiobook is intended for those listeners who want their minds expanded by the more complicated metaphysical ideas that border on quantum physics.</p>"; 
